import "./App.css";
import Card from "./components/UI/Card";
import Hotel from "./components/Hotel/Hotel";

const App = () => {
  const dummy = ["Calli", "80%", false, "double", "breakfast", "1000$"];

  return (
    <div className="App">
      <header className="App-header">
        <Card>
          <Hotel
            name={dummy[0]}
            rate={dummy[1]}
            oceanview={dummy[2]}
            roomtype={dummy[2]}
            mealtype={dummy[3]}
            price={dummy[4]}
          />
        </Card>
      </header>
    </div>
  );
};

export default App;
